import React, {useState,useEffect} from 'react'
import axios from 'axios'
function TestProgramare() {

    const[programare, setProgramare] = useState([])

    const getProgramareData = async () => {
        try {
            
            const data = await axios.get(
                "http://localhost:8080/api/programari"
            );
                console.log(data.data)
                setProgramare(data.data)

        } catch (error) {
            console.log(error);
        }
    }

    useEffect(()=>{
        getProgramareData();
    }, []);


  return (
    <div>
        {programare.map((item) =>{
            return (<p>{item.name}</p>);
        })}
    </div>
  )
}

export default TestProgramare
